 in our house, we have to pay two mortgages at the same time during the 8-month construction period?\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eAll of the four houses that are available, none of them are built? You don\\u0026#39;t have any that are already built and move in ready?\\u00a0\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eIs there a time tomorrow Thursday I can call you? Thank you for all your help!!\\u003c/div\\u003e\"},\"4\":1720931509},{\"1\":3,\"3\":{\"2\":\"\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eLong\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\"},\"4\":349463983},{\"1\":0,\"3\":{\"2\":\"\\u003c/div\\u003e\"},\"4\":1439293002},{\"1\":2,\"3\":{\"2\":\"\\u003cbr\\u003e\\u003cdiv class\\u003d\\\"gmail_quote\\\"\\u003e\\u003cdiv dir\\u003d\\\"ltr\\\" class\\u003d\\\"gmail_attr\\\"\\u003eOn Wed, Feb 10, 2021 at 12:51 PM Laura Taylor \\u0026lt;\\u003ca href\\u003d\\\"mailto:ltaylor@fxmessina.com\\\" target\\u003d\\\"_blank\\\"\\u003eltaylor@fxmessina.com\\u003c/a\\u003e\\u0026gt; wrote:\\u003cbr\\u003e\\u003c/div\\u003e\\u003cblockquote class\\u003d\\\"gmail_quote\\\" style\\u003d\\\"margin:0px 0px 0px 0.8ex;border-left:1px solid rgb(204,204,204);padding-left:1ex\\\"\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n\\u003cdiv lang\\u003d\\\"EN-US\\\"\\u003e\\r\\n\\u003cdiv\\u003e\\r\\n\\u003cdiv\\u003e\\r\\n\\u003cdiv id\\u003d\\\"m_-8769598074888789516gmail-m_2365889853396915071id-c8ee5ce4-9e14-453c-aa5a-947b31d630d1\\\"\\u003e\\r\\n\\u003cdiv\\u003e\\r\\n\\u003cdiv id\\u003d\\\"m_-8769598074888789516gmail-m_2365889853396915071id-a126a76d-2aae-487a-ae0f-fe97a0968324\\\"\\u003e\\r\\n\\u003cdiv\\u003e\\r\\n\\u003cdiv id\\u003d\\\"m_-8769598074888789516gmail-m_2365889853396915071id-42ca48d4-65b8-411f-8fbe-541940d45a9c\\\"\\u003e\\r\\n\\u003cdiv\\u003e\\r\\n\\u003cdiv id\\u003d\\\"m_- \\\"\\u003e\\r\\n\\u003cdiv\\u003e\\r\\n\\u003cp\\u003eThank you for your interest in Liberty Farms.\\u00a0 We currently have # 30, 50, 60 and 70 Jensen Farm Rd still available.\\u00a0\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eAttached are the floorplans of each and base specifications for all of our houses.\\u00a0\\u00a0 Please be informed that these are conservation lots, so we cannot move the house on the lot and we cannot change the\\u00a0\\u201cfoot print\\u201d of the house on the\\r\\n lot.\\u00a0 However, we can change the floorplan inside if you would like.\\u00a0 The floorplans attached are just preliminary and need to be finalized.\\u00a0\\u00a0\\u00a0 Below are the new plans for 60 Jensen Farm Rd, we just changed them.\\u00a0 We also may be changing # 70 as well.\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eI am also attaching some pictures of the interior of 40 Jensen Farm, a house we just completed,\\u00a0 for you to see some finished product.\\r\\n\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eThe price for 50 Jensen Farm will be starting around 960,000.\\u00a0 The base price for # 30, the one you mentioned is $ 985,000 it has approximately 3000 sq ft.\\u00a0 The base prices for\\u00a0\\u00a0 # 60 and # 70 may be slightly higher.\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eThe process for construction takes approximately 8 months from the signing of the Purchase and Sales.\\r\\n\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eYou would take out a traditional mortgage.\\u00a0 You pay deposit when signing Purchase and Sales ( usually its 10%) and then you pay for any upgrades that you may do to the house in advance.\\u00a0 The balance is paid by the bank at the closing.\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eI am working with a few other families currently, but they have not signed Purchase and Sales as of yet.\\u00a0\\r\\n\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003ePlease review and get back to me with any questions that you may have.\\r\\n\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eI look forward to hearing from you,\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u003cb\\u003e\\u003cspan style\\u003d\\\"font-size:14pt;font-family:\\u0026quot;Brush Script MT\\u0026quot;;color:rgb(6 96915071x_x_id-479c18b9-ba30-4ed5-964d-187442beda9c\\\"\\u003e\\r\\n\\u003cdiv\\u003e\\r\\n\\u003cdiv id\\u003d\\\"m_-8769598074888789516gmail-m_2365889853396915071x_x_id-2301cb43-bdcd-43cc-ab5f-c9417d3f9e31\\\"\\u003e\\r\\n\\u003cdiv\\u003e\\r\\n\\u003cp\\u003eThank you for your interest in Liberty Farms.\\u00a0 We currently have # 30, 50, 60 and 70 Jensen Farm Rd still available.\\u00a0\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eAttached are the floorplans of each and base specifications for all of our houses.\\u00a0\\u00a0 Please be informed that these are conservation lots, so we cannot move the house on the lot and we cannot change the\\u00a0\\u201cfoot print\\u201d of the house on the\\r\\n lot.\\u00a0 However, we can change the floorplan inside if you would like.\\u00a0 The floorplans attached are just preliminary and need to be finalized.\\u00a0\\u00a0\\u00a0 Below are the new plans for 60 Jensen Farm Rd, we just changed them.\\u00a0 We also may be changing # 70 as well.\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eI am also attaching some pictures of the interior of 40 Jensen Farm, a house we just completed,\\u00a0 for you to see some finished product.\\r\\n\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eThe price for 50 Jensen Farm will be starting around 960,000.\\u00a0 The base price for # 30, the one you mentioned is $ 985,000 it has approximately 3000 sq ft.\\u00a0 The base prices for\\u00a0\\u00a0 # 60 and # 70 may be slightly higher.\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eThe process for construction takes approximately 8 months from the signing of the Purchase and Sales.\\r\\n\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eYou would take out a traditional mortgage.\\u00a0 You pay deposit when signing Purchase and Sales ( usually its 10%) and then you pay for any upgrades that you may do to the house in advance.\\u00a0 The balance is paid by the bank at the closing.\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eI am working with a few other families currently, but they have not signed Purchase and Sales as of yet.\\u00a0\\r\\n\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003ePlease review and get back to me with any questions that you may have.\\r\\n\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003eI look forward to hearing from you,\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\r\\n\\u003cp\\u003e\\u00a0\\u003cu\\u00
